import './Card.css';

const Card = ({ teams }) => {

  const searchLeagues = e => {
    e.preventDefault();
    const keyword = e.target.elements.league.value.toUpperCase();
    fetchTeams(keyword);
  };

  return (
    <section>
      {teams.map((team, i) => <div >{team.name}</div>)}
      <Card teams={teams}/>
    </section>
  )
};

export default Card;
